def evaluate_axis_projection(projection):

    proj = list(projection.lower())
    if proj[0] == "x":
        axOnePos = 0
    elif proj[0] == "y":
        axOnePos = 1
    elif proj[0] == "z":
        axOnePos = 2
    if len(proj) > 1:
        if proj[1] == "x":
            axTwoPos = 0
        elif proj[1] == "y":
            axTwoPos = 1
        elif proj[1] == "z":
            axTwoPos = 2
        if len(proj) > 2:
            if proj[2] == "x":
                axThreePos = 0
            elif proj[2] == "y":
                axThreePos = 1
            elif proj[2] == "z":
                axThreePos = 2
        else:
            axThreePos = 3 - (axOnePos + axTwoPos)
    else:
        axTwoPos = 2 - axOnePos
        axThreePos = 3 - (axOnePos + axTwoPos)
    return axOnePos, axTwoPos, axThreePos

