def convert_arabic_to_roman(arabic):

    if int(arabic) > 39:
        return arabic

    to_roman = {
        1: 'I', 2: 'II', 3: 'III', 4: 'IV', 5: 'V', 6: 'VI', 7: 'VII',
        8: 'VIII', 9: 'IX', 10: 'X', 20: 'XX', 30: 'XXX'
    }
    roman_chars_list = []
    count = 1
    for digit in arabic[::-1]:
        digit = int(digit)
        if digit != 0:
            roman_chars_list.append(to_roman[digit * count])
        count *= 10
    return ''.join(roman_chars_list[::-1])

