def pad(string, length, pad=" ", pos=1.0):

    if not (0 <= pos <= 1):
        raise IndexError(f"bad pos: {pos}")

    string = str(string)
    if len(string) >= length:
        return string

    pad_len = len(pad)
    add     = length - len(string)
    right   = int(round(pos * add))
    left    = add - right
    if left > 0:
        string = pad * (left // pad_len) + pad[: left % pad_len] + string
    if right > 0:
        string = (
            string 
            + pad * (right // pad_len)
            + pad[: right % pad_len] 
        )
    return string

